import React from 'react'
import {Link} from 'react-router-dom'
import axios from 'axios'

const authAxios=axios.create({
	headers: {
		Authorization: 'Token 4b1753da4b54125d03cc04e814c071435c0deb35'
	}
});

class Home extends React.Component {
	constructor(props) {
		super(props)

		this.state = {
			context:{},
			error:''
		}
	}
	componentDidMount = ()=>{
		authAxios.get('http://localhost:8000/')
		.then(
			(response)=>{
				this.setState({context:response.data})
			}
		)
		.catch(
			(error)=>{
				this.setState({error:error.message})
			}
		)
	}
	render() {
		return (
			<div>
				Title: {this.state.context.title}
				Message: {this.state.context.message}
			</div>
		)
	}
}

export default Home
